// Header.js
import { FaBell, FaSearch, FaUserCircle } from "react-icons/fa";

const Header = () => {
  return (
    <header className="bg-gradient-to-br from-black to-blue-400 shadow-md p-4 flex items-center justify-between">
      {/* Branding/Logo - Attica Tracker */}
      <div className="text-3xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-yellow-500 to-purple-600 hover:scale-500 transition-transform duration-200">
        ATTICA TRACKER
      </div>

      {/* User and Notifications */}
      <div className="flex items-center space-x-4">
        <FaBell className="text-gray-200 text-2xl cursor-pointer hover:text-gray-900" />
        <div className="relative">
          <FaUserCircle className="text-gray-200 text-3xl cursor-pointer hover:text-gray-900" />
        </div>
      </div>
    </header>
  );
};

export default Header;
